<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<style>
    * {
        font-family: sans-serif;
        text-align: center;
    }
    #repo-list {
        display: grid;
        grid-template-columns: repeat(auto-fill, minmax(100px, 1fr));
        gap: 5px;
        padding: 5px;
    }
    img, video, audio {
        width: 100px;
        height: 100px;
        object-fit: cover;
        border-radius: 7px;
        cursor: pointer;
    }


    #lightbox {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: rgba(0,0,0,0.9);
    display: flex;
    justify-content: center;
    align-items: center;
    z-index: 1000;
    opacity: 0;
    pointer-events: none;
    transition: opacity 0.3s ease;
}

#lightbox.active {
    opacity: 1;
    pointer-events: auto;
}




    #lightbox-content {
        max-width: 90%;
        max-height: 90%;
    }
    #lightbox-content img {
        width: 500px; /* standard audio player size */
    height: auto;
    }
#lightbox-content video {
    width: 1000px; /* standard audio player size */
    height: auto;
}
#lightbox-content audio {
        width: 500px; /* standard audio player size */
        height: 50px;
    }
</style>
<title>List repos</title>
</head>
<body>
<h1>Amadeo Assets</h1>
<div id="repo-list"></div>

<!-- Lightbox -->
<div id="lightbox">
    <div id="lightbox-content"></div>
</div>
